Retired Army Gen. Stanley McChrystal says if asked, he wouldn't join the Trump administration because "it's important for me to work for people" who are "basically honest."

@MarthaRaddatz: "Is Trump immoral in your view?"

McChrystal: "I think he is." https://t.co/GLZ8jxN8F9 https://t.co/OO6Rh95I1k
